import { Doughnut } from 'react-chartjs-2'
import styled from 'styled-components'


const data = {
  datasets: [{
    data: [, (12.00 - 6)]
  }]
}

const DoughnutChart = props => {

  return (
    <Graph>
      <Doughnut 
        data={ data }
        width={ 150 }
        height={ 150 }
        options={{ 
          cutoutPercentage: 75, 
          rotation: (-1.25 * Math.PI),
          circumference: (1.5 * Math.PI)
        }}
      />
    </Graph>
  )
}

export default DoughnutChart    


const Graph = styled.div`
  width: 15rem;
  height: 15rem;
  border-radius: 100%
`
